import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, FlatList } from 'react-native';

const exercises = [
  "Упражнение 1",
  "Упражнение 2",
  "Упражнение 3",
  "Упражнение 4",
  "Упражнение 5",
  "Упражнение 6",
  "Упражнение 7",
  "Упражнение 8",
]

function Item({title, key}) {
  return (
    <Text key="key" style={styles.item}>{title}</Text>
  )
}

export default function App() {
  return (
    <View style={styles.container}>
      <View style={styles.list}>
        <FlatList 
          style={styles.list}
          data={exercises}
          renderItem={({item, index, separators}) => (
            <Item 
              title={item} 
              key={item}
            />
          )}
        />
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
  },
  list: {
    borderBottomColor: "#efefef",
    borderBottomWidth: 1
  },
  item: {
    fontSize: 22,
    paddingTop: 15,
    paddingBottom: 15,
    paddingLeft: 15,
    paddingRight: 15,
    borderTopColor: "#efefef",
    borderTopWidth: 1
  }
});
